import React from 'react';
import '../../styles/App.css';
import Footer from '../Footer';

export default function Sponsor() {
  return(
    <>
    <div>
        <h2>Sponsor</h2>
        <img style={{width:80, height:80}} alt="Ankama" src={require('../../Images/Ankama.png')}/>
        <img style={{width:80, height:80}} alt="Babelio" src={require('../../Images/Babelio.png')}/>
        <img style={{width:80, height:80}} alt="Zemmour" src={require('../../Images/GZ.png')}/>
        <img style={{width:80, height:80}} alt="Microsoft" src={require('../../Images/Microsoft.webp')}/>
    </div>
    <Footer/>
    </>
   );
}
